import { combineReducers } from "redux";

function productsApp(state = [], action) {
        
    switch (action.type) {
        case "FETCH_PRODUCTS":
        console.log(action.payload);

            return [...state, ...action.payload]
        default:
      return state;
    }
}


export default combineReducers({
    products:productsApp
})
